import Issues from './service/Issues'
import './app.scss'
import { withRouter } from 'react-router-dom'

function App () {
  const nextPath = path => {
    this.props.history.push(path)
  }

  return (
    <div className='container'>
      <button
        className='btn btn-success'
        onClick={() => this.nextPath('/create')}
      >
        Add Issue
      </button>
      <Issues />
    </div>
  )
}

export default App
